import React from 'react';
import{Container,Navbar} from "react-bootstrap";
import './App.css'; 


function Nav() {
  return (
    <div>
     <Container>
        <Navbar  expand="lg" variant="danger" bg="danger">
         <Navbar.Brand href="#">Navbar</Navbar.Brand>
       </Navbar>
    </Container>




    </div>
  )

}

export default Nav;
